import React, { Component } from "react";

class Table extends Component {
  state = {};
  render() {
    const { activities } = this.props;
    console.log(activities);
    return (
      <table className="table table-striped">
        <thead>
          <tr>
            {Object.keys(activities[0]).map((attribute) => (
              <th key={attribute}>{attribute} scope="col"</th>
            ))}
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
